(1, 'No Package', NULL, NULL, '', '', '', '', '', 0, 0, '', 0, 0),
(4, 'Alo', '1602794861-66426524.jpg', '1602975011-51383548.jpg', '<ul>\r\n<li>Coverage up to Taka 13,000</li>\r\n<li>Duration: 3 months</li>\r\n<li>Price: Taka 99</li>\r\n</ul>', '<ul>\r\n<li>1 person covered</li>\r\n<li>Aged between 5 to 65 years</li>\r\n<li>Valid for 3 months from the date of registration</li>\r\n<li>Taka 250 can be claimed for each night of hospitalization under Hospital Cash Coverage</li>\r\n<li>Health and Lifestyle Discounts can be availed at ChhayaTM partner outlets only</li>\r\n</ul>', '<ul>\r\n<li>7 days waiting period after registration will be applied for Hospital Cash Coverage</li>\r\n<li>Minimum 24 hours of hospitalization is needed for Hospital Cash Coverage eligibility</li>\r\n<li>Maximum 3 nights of hospitalization at a stretch is covered under Hospital Cash Coverage</li>\r\n<li>A BMDC registered doctor must prescribe for the hospitalization</li>\r\n</ul>', '<ul>\r\n<li>All pre-existing disease related to all types of coverage of the policy</li>\r\n<li>Death caused by self-inflicted injury or the commission of or attempted commission of an assault or any unlawful act, or being engaged in any illegal activity or felony</li>\r\n<li>By participating in any types of illegal activities</li>\r\n<li>Suicide while sane or insane</li>\r\n<li>The condition of Acquired Immune Deficiency Syndrome (AIDS), or any AIDS related illness or HIV virus</li>\r\n<li>Any congenital infirmity</li>\r\n<li>Any minor surgery, daycare treatment</li>\r\n<li>Circumcision, prophylactic and immunization procedures</li>\r\n<li>Mental, emotional or psychiatric disorders, alcoholism or any other narcotic addiction</li>\r\n<li>Obesity i.e., treatment for, or required as a result of obesity, any cosmetic or plastic treatment/surgery, unless required as reconstructive surgery as a consequence of an injury due to accidents, burns</li>\r\n<li>Any procedures which is experimental or not generally accepted by the medical profession viz. acupuncture, herbal/ayurvedic/homeopathy treatment and any Alternative Medical Care (AMC) etc.</li>\r\n<li>Treatment or advice by a person or professional not registered under BMDC (Bangladesh Medical &amp; Dental Council)</li>\r\n<li>Rest, convalescence or rejuvenation cures, thermal baths, physiotherapy or confinement for the purposes of slimming or beautification</li>\r\n<li>Fracture and trauma due to physical assault, injury arising due to accident while participating in any unlawful activities (e.g., driving a car without a license), attempted suicide, violation or attempted violation of the law, injuries willfully or intentionally self-inflicted or due to insanity or under the influence of a drug</li>\r\n<li>Assembly of artificial limbs &amp; necessary treatment of the said artificial limbs (unless required due to accident)</li>\r\n<li>Routine examination of eye and ear, fitting or replacement of eyeglasses (including Intra-ocular lens or contact lenses) or hearing aids, health screening including routine physical examinations (health check-ups), malignant cancer, radiotherapy, chemotherapy, dialysis and any dental treatment unless require hospitalization for re-constructive surgery as a consequence of an accident</li>\r\n<li>Non-surgical care for tuberculosis, hepatitis B &amp; C and any other vaccinations, epidemic/pandemic, all expenses incurred in connection with the donor for any treatment, AIDS and HIV diseases, lupus and other connective tissue and autoimmune disorders and costs of prostheses, corrective devices</li>\r\n<li>Sleep disorders i.e., treatment for insomnia, sleep apnea, snoring, or any other sleep related breathing problem</li>\r\n<li>IgE test, vitamin tests</li>\r\n<li>Participating in competitions, races, contest, matches, on land, air or sea; pot-holing, paragliding, bungee jumping, parachuting and/or scuba diving</li>\r\n<li>Treatment of family planning purposes including termination of pregnancy, sterility or treatment related to assisted reproduction, cost of contraception, cost of female hygiene product like sanitary pads, etc.</li>\r\n<li>Mental, emotional or psychiatric disorders, alcoholism or any other narcotic addiction</li>\r\n<li>Injury arising due to accident while participating in any unlawful activities (e.g., driving a car without a license), attempted suicide, violation or attempted violation of the law, injuries willfully or intentionally self-inflicted or due to insanity or under the influence of a drug</li>\r\n</ul>', '1,2,3,4,5', 8, 0, 'a:2:{i:0;a:2:{s:16:\"number_of_people\";s:1:\"1\";s:5:\"price\";s:2:\"99\";}i:1;a:2:{s:16:\"number_of_people\";N;s:5:\"price\";N;}}', 0, 1),
