(1, 'Chhaya Personal Protection', 'personal-protection', 'Chhaya Personal Protection', 'Chhaya Personal Protection description', '4,5,6', '1603139617-14123036.jpg', '1599405240-90080173.jpg', '<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #666666; font-family: \'Open Sans\', sans-serif;\">When buying life insurance, an insured amount is paid out to the beneficiary upon the death of the insured. The policyholder pays a regular amount, called premium, in order to receive the coverage. These premiums are based on factors, such as age, gender, medical history, and the value amount of life insurance you purchase.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #666666; font-family: \'Open Sans\', sans-serif;\">When buying life insurance, an insured amount is paid out to the beneficiary upon the death of the insured. The policyholder pays a regular amount, called premium, in order to receive the coverage. These premiums are based on factors, such as age, gender, medical history, and the value amount of life insurance you purchase.</p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 20px; color: #666666; font-family: \'Open Sans\', sans-serif;\">When buying life insurance, an insured amount is paid out to the beneficiary upon the death of the insured. The policyholder pays a regular amount, called premium, in order to receive the coverage. These premiums are based on factors, such as age, gender, medical history, and the value amount of life insurance you purchase.</p>', '<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 10px 0px; color: #666666; font-family: \'Open Sans\', sans-serif;\"><span style=\"box-sizing: inherit; font-family: Calibri;\">Making up for your lost income</span></p>\r\n<p class=\"MsoNormal\" style=\"box-sizing: inherit; margin: 10px 0px; color: #666666; font-family: \'Open Sans\', sans-serif;\"><span style=\"box-sizing: inherit; font-family: Calibri;\">Funding a child&rsquo;s education</span></p>\r\n<p cl