(1, 'প্রতিদিন মাত্র ১ টাকায় সারা বছরের সুরক্ষা', '1602065288-5622428.jpg', 'মাত্র ৩৬৫ টাকায় উপভোগ করুন ৩৬৫ দিনের জীবনবীমা, স্বাস্থ্যবীমা ও দুর্ঘটনাজনিত বীমা কভারেজ। এছাড়াও আছে তিন মাস ও ছয় মাস মেয়াদী সুলভ দুটি সমাধান।', 'বিস্তারিত দেখুন', '/products/personal-protection', '1', 1),
(2, 'বীমা করুন, ঝুঁকি কমান', '1602065312-99171649.jpg', 'আপনার প্রতিষ্ঠান ও ব্যবসায়িক কর্মকান্ডের সুরক্ষা এবং কর্মকর্তা, কর্মচারী ও মাঠ পর্যায়ের কর্মীদের জীবন, দুর্ঘটনা ও স্বাস্থ্যবীমা নিশ্চিত করতে আমরা আছি আপনারই পাশে।', 'বিস্তারিত দেখুন', '/products/business-solution', '1', 2),
(3, 'সন্তানের শিক্ষা নিয়ে আর নয় দুশ্চিন্তা', '1602065324-41989497.jpg', 'আপনার সন্তানের পড়াশোনা নির্বিঘ্নে চালিয়ে যাওয়া নিশ্চিত করতে আজই গ্রহণ করুন আমাদের শিক্ষা অর্থায়ন ও শিক্ষা বীমা সমাধানসমূহ।', 'বিস্তারিত দেখুন', '/products/chhaya-edu-shield', '1', 8),
(4, 'কৃষিতে বিনিয়োগও এখন সুরক্ষিত', '1602065335-42601701.jpg', 'প্রাকৃতিক কিংবা দুর্বিপাকজনিত কারণে আপনার কৃষি এবং মৎস্য ও পশুপালন প্রকল্পের সম্ভাব্য ক্ষতির মোকাবেলায় আজই গ্রহণ করুন আমাদের এগ্রি শিল্ড সমাধানসমূহ।', 'বিস্তারিত দেখুন', '/products/chhaya-agri-shield', '1', 9);

